import React from "react";
import { NavLink } from "react-router-dom";

function Header() {
    return (
        <nav>
            <NavLink exact activeClassName="active" to="/">
                Home
            </NavLink>
            <NavLink activeClassName="active" to="/login">
                Login
            </NavLink>
            <NavLink activeClassName="active" to="/signup">
                Signup
            </NavLink>
        </nav>
    );
}

export default Header;
